index.css:
.center {
    text-align: center;
    display: none;
    font-size: 13px;
    font-weight: 400;
    margin-top: 20px;
}

.sb-content-tab .center {
    display: block;
}

.sb-content-tab #wrapper {
    display: none;
}

.footerTemplate {
    text-indent: 1.2em;
    display: block;
    font-size: 13px;
    line-height: 30px;
    border-top: 0.5px solid #e0e0e0;
}

#wrapper {
    width: 100%;
    height: 100%;
}

body {
    margin: 0;
    height: 100%;
    width: 100%;
    overflow: hidden;
}

/** Document editor sample level styles*/

#panel {
    height: 100%;
    width: 100%;
    user-select: none;
    -moz-user-select: none;
    -khtml-user-select: none;
    -webkit-user-select: none;
    -o-user-select: none;
}

#documenteditor_container_panel {
    width: 100%;
    height: 100%;
    border: solid 1px #D9D9D9;
}


.overlay {
    z-index: 10;
    display: none;
    position: fixed;
    background-color: #383838;
    height: 100%;
    width: 100%;
    opacity: .5;
    left: 0;
    top: 0;
}


[contenteditable="true"].single-line {
    white-space: nowrap;
    border-color: #e4e4e4 !important;
}

[contenteditable="true"].single-line * {
    white-space: nowrap;
}
#documenteditor_titlebar {
    height: 36px;
    line-height: 26px;
    width: 100%;
    font-size: 12px;
    padding-left: 15px;
    padding-right: 10px;
    font-family: inherit;
}

#documenteditor_title_contentEditor {
    height: 26px;
    max-width: 85%;
    width: auto;
    overflow: hidden;
    display: inline-block;
    padding-left: 4px;
    padding-right: 4px;
    margin: 5px;
}


.single-line {
    cursor: text !important;
    outline: none;
}

    .single-line:hover {
        border-color: #e4e4e4 !important;
    }

[contenteditable="true"].single-line {
    white-space: nowrap;
    border-color: #e4e4e4 !important;
}


/** Document editor sample level font icons*/

@font-face {
    font-family: 'Sample brower icons';
    src: url(data:application/x-font-ttf;charset=utf-8;base64,) format('truetype');
    font-weight: normal;
    font-style: normal;
}

[class^="e-de-icon-"],
[class*=" e-de-icon-"] {
    font-family: 'Sample brower icons' !important;
}

.e-de-icon-Print:before {
    content: "\e723";
}

.e-de-icon-Download:before {
    content: "\e70a";
}

#AutosaveLog b {
    color: #388e3c;
}

#AutosaveLog hr {
    margin: 1px 10px 1px 0px;
    border-top: 1px solid #eee;
}

